text:
all month long we've been sharing and celebrating incredible black women you should know 💕

@taranajaneen is the founder of just be inc.--a nonprofit that helps sexual assault victims--and the woman who  began #metoo movement. 
in an oct. 2017 @nytimes article, burke explained that the phrase was coined after hearing a 13 year old girl's assault story, where “[she] didn’t have a response or a way to help her in that moment, and [she] couldn’t even say ‘me too." since then she's worked to help others who, like herself, were victims of sexual assault and was the catalyst for the mainstream #metoo movement. let's lift her up and celebrate all the work she's done

