text:
gewalt an frauen* führt für die betroffenen oftmals zu noch mehr gewalt: durch stigmatisierung, durch mediales anprangern, durch fehlverhalten und druck zuständiger stellen. dass bis heute kaum über die an dieser geschichte beteiligten svp-männer gesprochen wird und diese sich auch nie öffentlich äussern mussten, zeigt wie viel wir noch zu tun haben. gleichzeitig macht sich die svp hinsichtlich der kommenden wahlen gegen gewalt an frauen* stark. aber eben nur, wenn sie nicht aus den eigenen reihen kommt und bitteschön rassistische feinbilder bedient.

#rapeculture #svp #kotropfen #medien #verantwortung #metoo #mehrmännlichkeiten #gegengewaltanfrauen #victimblaming
@jolandaspiess

